import React from 'react'
import PropTypes from 'prop-types'

class Items extends React.Component{
  constructor(props){
    super(props)
    this.state.itemName=""
  }
  render () {
    return (
      <div>
        <img url="" alt=""/>
        <h1>{this.itemName}</h1>
      </div>
    )
  }
}

export default Items;
